22.body:
#use nommy::{Parse};
#[derive(Parse)]
pub enum OnlyFoo { Foo(Tag<"foo">), Foob(Tag<"foob">),
} In this example, the OnlyFoo enum can never parse into a variant of Foob. To see why, let's put in the input "foob". Since enum parsers try to parse each variant in order, it will first try to parse the Foo variant. This will match the input "foo", and that is indeed found in the input sequence, therefore the result is OnlyFoo::Foo and the input sequence will have 'b' remaining. One way to solve this is to swap the order, however that might not always be possible. It might be possible to configure greedy evaluation in the future, however that is currently not possible.

