parser lets you specify how to parse the input into the type specified. For example, parsing letters into a string: #use nommy::{Parse, IntoBuf, text::AnyOf1}; type Letters = AnyOf1<"abcdefghijklmnopqrstuvwxyz">; # #[derive(Debug, PartialEq)]
#[derive(Parse)]
pub struct Word ( #[nommy(parser = Letters)] String,
); let mut buffer = "foo bar".chars().into_buf();
assert_eq!(Word::parse(&mut buffer).unwrap(), Word("foo".to_string())); This works because Letters implements Into<String>.

