inner_parser lets you specify how to parse the input into the vec type specified. For example, parsing letters into a string: #use nommy::{Parse, IntoBuf, text::OneOf}; type Letter = OneOf<"abcdefghijklmnopqrstuvwxyz">; # #[derive(Debug, PartialEq)]
#[derive(Parse)]
pub struct Letters ( #[nommy(inner_parser = Letter)] Vec<char>,
); let mut buffer = "foo bar".chars().into_buf();
assert_eq!(Letters::parse(&mut buffer).unwrap(), Letters(vec!['f', 'o', 'o'])); This is necessary because Vec<P> does not implement Into<Vec<Q>> even if P: Into<Q>.

