This example implementation of Parse reads from a char Buffer , parsing a representation of a string. /// StringParser parses a code representation of a string
struct StringParser(String);
impl Parse<char> for StringParser { fn parse(input: &mut impl Buffer<char>) -> eyre::Result<Self> { // ensure the first character is a quote mark if input.next() != Some('\"') { return Err(eyre::eyre!("starting quote not found")); } let mut output = String::new(); let mut escaped = false; // read from the input until the ending quote is found for c in input { match (c, escaped) { ('\"', true) => output.push('\"'), ('n', true) => output.push('\n'), ('r', true) => output.push('\r'), ('t', true) => output.push('\t'), ('\\', true) => output.push('\\'), (c, true) => return Err(eyre::eyre!("unknown escaped character code \\{}", c)), ('\"', false) => return Ok(Self(output)), ('\\', false) => { escaped = true; continue; } (c, false) => output.push(c), } escaped = false; } Err(eyre::eyre!("ending quote not found")) }
}

