This is the same example from the Parsers section, but instead implementing peek. It follows a very similar implementation, but avoids a lot of the heavy work, such as dealing with errors and saving the chars to the string buffer /// StringParser parses a code representation of a string
struct StringParser(String);
impl Parse<char> for StringParser { #fn parse(input: &mut impl Buffer<char>) -> Result<Self> { #unimplemented!() #} # fn peek(input: &mut impl Buffer<char>) -> bool { // ensure the first character is a quote mark if input.next() != Some('\"') { return false; } let mut escaped = false; // read from the input until the ending quote is found for c in input { match (c, escaped) { ('\"', true) => { escaped = false } ('n', true) => { escaped = false } ('r', true) => { escaped = false } ('t', true) => { escaped = false } ('\\', true) => { escaped = false } (c, true) => return false, ('\"', false) => return true, ('\\', false) => { escaped = true; } _ => {}, } } false }
}

